import TeamMember from "./TeamMember";
import x from "./data";
function Team() {
    let st = "";
    x.forEach(element => {
       st+=`<TeamMember ${element} />`;    
    });
    let c = x.map(function(member){
       return  <TeamMember {...member} /> ;
    });
  return (
    <div>
      <div class="row">
      {c}
      </div>
    </div>
  );
}

export default Team;
